  const timeOptions = ['morning', 'noon', 'afternoon', 'evening', 'midnight'];
  const weatherOptions = ['snowy', 'rainy', 'cool', 'sunny', 'hot'];

  return (
    <div class="hey">
    <RadioGroup options={timeOptions} />
    <RadioGroup options={weatherOptions} />
    </div>
  )
}

export default SelectionPage;
